import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { ArrowBackIos, ArrowForwardIos } from "@material-ui/icons";

const Ipl = () => {
  return (
    <div>
      {/* <h1>IPL</h1> */}
      <div className="">
        <h1>Match HightLights</h1>
        <div className="">prev</div>
        <div className="">next</div>
      </div>
      <div className="">
        <Slider>
          {Array(10)
            .fill("")
            .map(() => {
              <img
                src="https://resources.pulse.icc-cricket.com/photo-resources/2021/08/15/f9afac9f-f6b9-4def-8ca5-001cc5fd3d0e/Round-1-T20WC.png?width=845&height=1056"
                alt=""
              />;
            })}
        </Slider>
      </div>
    </div>
  );
};

export default Ipl;
